import React from "react";
import AppHeader from "../../components/AppHeader";

const CategotyBox = styled.div`

`;
const Employment = () => { 
    return(
        <>
            <AppHeader />
            <CategotyBox>
                여기다가 카테고리 넣자
            </CategotyBox>
        </>
    );
}

export default Employment;
